class MyRouter {
  static slug = "[slug]"
  static Home = {href:"/"}
  static Products = {href:"/products"}
  static ProductsList = {href:`${this.Products.href}/${this.slug}`, as: (slug) => `${this.Products.href}/${slug}`}
  static ProductDetail = {href:`${this.Products.href}/${this.slug}`, as: (slug,id) => `${this.Products.href}/${slug}~${id}`}
}
export default MyRouter
